import React from "react";

import styles from "./projectstyles.module.css";
import { ProjectList } from "./ProjectList";

export default function Projects(props) {
  let projects = ProjectList.map((project, index) => (
    <div className={styles.main}>
      <h1 className={styles.header}>{project.name}</h1>
      <img
        className={styles.img}
        src={project.imgsrc}
        alt={project.name}
        // style={{width:props.width, height:props.height}}
      />

      <div className={styles.headerwrap}>
        <p>Github repository:{project.github}</p>
        <p>Live site:</p>
      </div>
    </div>
  ));

  return (



    <div className={styles.main} style={{ background: props.color }}>
      {/* <h1 className={styles.header}>{props.name}</h1>
      <img
        className={styles.img}
        src={props.imgscr}
        alt={props.name}
        style={{ width: props.width, height: props.height }}
      />
      <div className={styles.headerwrap}>
        <p>Github repository:{props.repo}</p>
        <p>Live site:</p>
      </div> */}

      <ul>{projects}</ul>
    </div>
  );
}
